/* ========================================================= */
/* VARIABLES DE COLOR */
/* ========================================================= */
:root {
    --color-elegante: #FFFFFF; /* Texto Blanco para contrastar con el fondo oscuro */
    --naranja-degradado-inicio: #03478A; /* Naranja Suave (Light Salmon) */
    --naranja-degradado-fin: #6D98C2; /* Naranja Medio (Coral) */
    --color-borde-base: #FF7F50; /* Color simple para el borde base */
}

/* ========================================================= */
/* 1. Fondo de la Página: Degradado Azul Cielo (Se mantiene) */
/* ========================================================= */
body, .container-fluid {
background: linear-gradient(180deg, #E0F7FA 0%, #B3E5FC 100%) !important;    min-height: 100vh;
}

/* ========================================================= */
/* 2. Estilo de las Secciones: Efecto Tarjeta/Sombreado (Se mantiene) */
/* ========================================================= */
.panel, .rnr-c-body, .rnr-c-grid {
    background-color: #FFFFFF !important; 
    border: none !important; 
    border-radius: 12px !important; 
    padding: 20px;
    margin-bottom: 25px; 
    box-shadow: 0 6px 20px rgba(0, 0, 0, 0.1), 
                0 2px 6px rgba(0, 0, 0, 0.05) !important; 

    /* 🔑 CAMBIO CLAVE: Agrega 'transform' a la transición */
    transition: box-shadow 0.3s ease-in-out, 
                transform 0.3s ease-in-out; /* Transición para el movimiento y escala */            

}

/* ========================================================= */
/* 3. Estilo de Encabezados de Sección (EL CAMBIO PRINCIPAL) */
/* ========================================================= */
.panel-heading, .rnr-c-head {
    /* Aplicamos el degradado al fondo completo del encabezado */
    background: linear-gradient(to right, var(--naranja-degradado-inicio), var(--naranja-degradado-fin)) !important;

    /* El texto del título ahora es blanco para contrastar con el fondo naranja */
    color: var(--color-elegante) !important; 

    font-weight: 600;

    /* Mantenemos el centrado vertical */
    display: flex;
    align-items: center;
    height: 40px; /* Aseguramos una altura suficiente */

    /* Eliminamos el borde degradado y aplicamos un borde simple y fino abajo */
    border-bottom: 1px solid var(--color-borde-base) !important; 
    border-image-source: none !important; /* Desactivar la propiedad border-image anterior */

    /* Ajustes de relleno/bordes para que el degradado se vea bien */
    padding: 0 15px !important; 
    border-top-left-radius: 12px !important; /* Mantenemos el radio del panel superior */
    border-top-right-radius: 12px !important;
}

/* ========================================================= */
/* 3. Estilo de HOVER: Efecto de Elevación/Intensificación    */
/* ========================================================= */
.panel:hover, .rnr-c-body:hover, .rnr-c-grid:hover {
    /* Nueva sombra más intensa y "elevada" */
    box-shadow: 0 15px 400px rgba(0, 0, 0, 0.3), 
                0 5px 15px rgba(0, 0, 0, 0.1) !important; 

    /* Pequeño movimiento hacia arriba para dar más sensación de elevación (opcional) */
    transform: translateY(-5px) scale(1.005); 
}



/* 4. Estilo de los Inputs (Se mantiene) */
.form-control {
    border-radius: 8px !important; 
    border: 1px solid #e0e0e0 !important;
}
.form-control:focus {
    border-color: #48C9B0 !important; 
    box-shadow: 0 0 0 0.2rem rgba(72, 201, 176, 0.25) !important;
}

/* Aplica solo a formularios con esas secciones */
.panel.panel-default.form-section > .panel-body { display: none; }

.panel.panel-default.form-section > .panel-heading:hover {
  cursor: pointer;
  filter: brightness(0.98);
}

/* ========================================================= */
/* ARREGLO DE COLOR DE TEXTO DE ENCABEZADO DURANTE MODAL     */
/* ========================================================= */

/* Apuntamos directamente al panel-title, que es el elemento que contiene 
   el texto del encabezado de la sección. 
*/
.panel-heading .panel-title {
    color: #FFFFFF !important; 
}

/* Si dentro del panel-title hay un enlace (Ej. si el encabezado permite colapsar/expandir 
   y el título es un <a>), también debemos forzar el color del enlace.
*/
.panel-heading .panel-title a {
    color: #FFFFFF !important;
}

/* Asegurar que el texto dentro del panel-title no se vea afectado por reglas generales
   que usen el estado 'modal-open' en el cuerpo de la página.
*/
.modal-open .panel-heading .panel-title {
    color: #FFFFFF !important;
}

